        private static IList<long> MinOperations(int[] nums, int[] queries)
        {
            int n = nums.Length;
            int m = queries.Length;
            Array.Sort(nums);
            long[] x = new long[m];
            long[] y = new long[n];

            y[0] = nums[0];
            for (int i = 1; i < n; i++)
            {
                y[i] = nums[i] + y[i - 1];
            }

            for (int i = 0; i < m; i++)
            {
                int crt = queries[i];
                int index = Array.BinarySearch(nums, crt);

                if (index < 0) index = ~index;

                long l = index == 0 ? 0 : y[index - 1];
                long r = index == 0 ? y[^1] : y[^1] - y[index - 1];
                x[i] = (long)crt * index - l + r - (long)crt * (y.Length - index);
            }

            return x;
        }
    }
